import React from 'react';
const Movie = (props) => {
  const { movie } = props;

  return (
    <li className="list-group-item">
        <div className="row">
            <div className="col-4">
                <img className="img-fluid" src="{movie.image}" />
            </div>
            <div className="col-8">
                <h5>{movie.rank}. {movie.fullTitle}</h5>
            </div>
        </div>
    </li>    
  )
}

export default Movie;
